/*
 * ===================================================================
 * Minecraft DLL注入器 - 主程序文件
 * ===================================================================
 *
 * 这个程序的作用：
 * 1. 把我们的代码注入到Minecraft游戏进程中
 * 2. 劫持Java虚拟机的函数调用
 * 3. 在游戏运行时执行我们自己的Java代码
 * 4. 实现各种游戏功能（比如自动挖矿、透视等）
 *
 * 工作原理简述：
 * Minecraft是Java程序 → 运行在JVM上 → 我们hook JVM函数 → 获取控制权
 */
